import React, { useEffect, useState } from 'react';

const ViewAllOrder = () => {
    const [order,setAllOrder]= useState([]);

    useEffect(()=>{
        fetch('http://localhost:5000/allProducts')
        .then(res =>res.json())
        .then(data=>setAllOrder(data));
    },[])
    return (
        <div>
            <h2>this is from view all order </h2>
        </div>
    );
};

export default ViewAllOrder;
